import React, { Component } from 'react'

class Main extends Component {

  render() {
    return (
      <div>
        <h1>Your Stats as a {this.props.isMale}</h1>
        <h2>{window.web3.utils.fromWei(this.props.loveCoinBalance,"Ether")} LUV</h2>
        <h2>{this.props.loveScore} Score</h2>
      </div>
    );
  }
}

export default Main;
